{% load custom_tags %}
{% load static %}

<!doctype html>
<html>
  <head>
    <meta charset="utf-8">
    <title>{{ title }}</title>
    <meta name="description" content="{{ title }}">
    <meta name="author" content="HTC-MIS">

    <style type="text/css" media="print">
    @charset "UTF-8";
    @import url('https://fonts.googleapis.com/css?family=Times+New+Roman');
    @page {
        size: A4;
        margin: 1.5cm;
    }

    html {
        color: #14213d;
        font-family: 'Roboto', sans-serif;
        font-size: 9pt;
        line-height: 1.6;
    }

    html body {
        margin: 4px;
    }

    html section#title h1 {
        font-size: 20pt;
        margin-top: 4em;
        text-align: center;
        font-weight: inherit;
    }

    html section#title h2 {
        font-size: 12pt;
        margin-top: 0em;
        margin-bottom: 0em;
        text-align: center;
        font-weight: normal;
    }

    html section#title h3 {
        font-size: 12pt;
        margin-top: 1em;
        margin-bottom: 0em;
        text-align: center;
        font-weight: normal;
        text-decoration:underline;
    }

    html img.logo_left {
        width: 320px;
        height: 50px;
        float: left;
    }

    html img.logo_right {
        width: 175px;
        height: 90px;
        float: right;
    }

    html table {
        border: 1px solid black;
        border-collapse: collapse;
        width: 100%;
        table-layout: fixed;
    }

    html table td.header {
        background-color: #02b0f0;
        color: white;
        font-size: 14px;
        text-align: center;
        font-weight: bold;
        text-transform: uppercase;
    }

    html table th,
    html table td {
        text-align: left;
        border: 1px solid black;
        padding: 1px;
        word-wrap: break-word;
        max-width: 200px;
    }

    html table td.height45 {
        height: 30px;
    }
</style>

  </head>
